/*Table structure for table `t_loginuser` */

DROP TABLE IF EXISTS `t_loginuser`;

CREATE TABLE `t_loginuser` (
  `uid` int(11) NOT NULL AUTO_INCREMENT,
  `upass` varchar(20) NOT NULL DEFAULT '111',
  `flag` int(2) NOT NULL DEFAULT '1',
  `ustate` int(2) NOT NULL DEFAULT '1',
  `tid` int(11) DEFAULT NULL,
  `aid` int(11) DEFAULT NULL,
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=111118 DEFAULT CHARSET=utf8;

/*Data for the table `t_loginuser` */

insert  into `t_loginuser`(`uid`,`upass`,`flag`,`ustate`,`tid`,`aid`) values (111,'111',1,1,111,NULL),(111111,'111',0,1,NULL,NULL),(111117,'233',1,1,NULL,NULL);

/*Table structure for table `t_teadetail` */

DROP TABLE IF EXISTS `t_teadetail`;

CREATE TABLE `t_teadetail` (
  `tid` int(20) NOT NULL AUTO_INCREMENT,
  `tname` varchar(20) NOT NULL,
  `tcollege` varchar(20) NOT NULL,
  `tposition` varchar(20) NOT NULL,
  `balance` double NOT NULL DEFAULT '0',
  PRIMARY KEY (`tid`)
) ENGINE=InnoDB AUTO_INCREMENT=20151603 DEFAULT CHARSET=utf8;

/*Data for the table `t_teadetail` */

insert  into `t_teadetail`(`tid`,`tname`,`tcollege`,`tposition`,`balance`) values (111,'zhangsan','信息科学与工程学院','讲师',20),(20151601,'王老师','外语学院','教授',500),(20151602,'赵老师','新闻与传播学院','讲师',99);

